                'It seems that Facebook has restricted access to the business account. Please go to your Facebook business account and follow the instructions. Then, click "Log out" and reauthorize the %s integration.': 'Кажется, Facebook ограничил доступ к бизнес-аккаунту. Пожалуйста, перейдите в бизнес-аккаунт Facebook и следуйте инструкции, после чего нажмите "Выйти" и повторно авторизуйтесь в интеграции %s.',
                "It looks like we were unable to obtain the necessary permission to connect your %s page (%t). Please allow us to access your messages by following": "Кажется, мы не смогли получить доступы для подключения страницы %s (%t). Пожалуйста, разрешите нам доступ к сообщениям, выполнив",
