                'It seems you’ve restricted our access to "View and manage messages for the Instagram account connected to the Page." Please grant us access and re-add the (%s) Instagram page.': 'Кажется, вы ограничили нам доступ к "Просмотр сообщений для аккаунта Instagram, подключенного к Странице, и управление ими". Пожалуйста, разрешите нам доступ и заново добавьте страницу Instagram (%s).',
