                SPA_TEMPLATE__NEW_IMPORT_MODAL_DESCR: '<p>Если у вас уже есть база клиентов в Excel-файле, то просто загрузите их в amoCRM и начните работу с ними. Импорт поддерживает следующие форматы файлов .xls, .xlsx, .ods и .csv. Импорт позволяет  импортировать разом компании, контакты, {{leads.plural_form.default}}, покупателей, все дополнительные поля и примечания. Структура файла может быть любой. После загрузки файла Вам необходимо будет настроить соответствие колонок в файле и данными amoCRM или выбрать ваш шаблон импорта. Для импортируемых данных вы можете задать необходимый тег. Завершив настройки соответствия колонок, вы можете сохранить настройки в виде шаблона импорта. Затем нажать на кнопку "Далее".</p><p>P.S. Если у Вас в загружаемом файле есть поле "Дата", то Вам нужно перевести Excel-файл в формат "CSV (разделители запятые)". Для этого в Excel нажмите "сохранить как", далее выберите формат "CSV (разделители запятые)" и нажмите "сохранить".</p>',
                "import catalog decription": 'Если у вас уже есть база списков в Excel-файле, то просто загрузите их в amoCRM и начните работу с ними. Импорт поддерживает следующие форматы файлов .xls, .xlsx, .ods и .csv. Импорт позволяет импортировать все дополнительные поля. Структура файла может быть любой. После загрузки файла Вам необходимо будет настроить соответствие колонок в файле и данными amoCRM или выбрать ваш шаблон импорта. Завершив настройки соответствия колонок, вы можете сохранить настройки в виде шаблона импорта. Затем нажать на кнопку "Далее". <br/>P.S. Если у Вас в загружаемом файле есть поле "Дата", то Вам нужно перевести Excel-файл в формат "CSV (разделители запятые)". Для этого в Excel нажмите "сохранить как", далее выберите формат "CSV (разделители запятые)" и нажмите "сохранить".',
