                "The volume of emails you send via amoCRM exceeds the limit for unconnected domains. To remove this restriction and continue sending messages, you must connect the domain.": "Объем писем отправляемых вами через amoCRM, превышает лимит для не подключенных доменов. Чтобы снять это ограничение и продолжить отправку писем, необходимо подключить домен.",
                "SPF, DKIM are the methods used to authenticate the sender. AmoCRM does not require the addition this records. If you plug in the domain, you can send more letters, via amoCRM. Also, for sent letters, the reputation of your domain will be taken into account, which reduces the probability of getting letters in spam.": '<span class="mailbox-domain-modal__desc-title">SPF, DKIM</span> - это методы, используемые для проверки подлинности отправителя. AmoCRM не требует обязательного добавления данных записей. Подключив домен вы сможете отправлять больший объем писем, через amoCRM. Также, для отправляемых писем, будет учитывается репутация вашего домена, что уменьшает вероятность попадания писем в спам.',
                "DKIM (Domain Keys Identified Mail) is a digital signature used by email services to identify and classify legitimate e-mail. When sending a message, amoCRM will add a digital signature associated with your corporate domain. The signature is automatically checked on the recipient's side.": '<span class="mailbox-domain-modal__desc-title">DKIM (Domain Keys Identified Mail)</span> — цифровая подпись, используемая почтовыми сервисами для идентификации и классификации легитимной электронной почты. При отправке сообщения amoCRM будет добавлять цифровую подпись, связанную с вашим корпоративным доменом. Подпись автоматически проверяется на стороне получателя.',
                "SPF (Sender Policy Framework) allows you to limit the list of servers from which you can send messages on behalf of your domain.": '<span class="mailbox-domain-modal__desc-title">SPF (Sender Policy Framework)</span> позволяет ограничить список серверов, с которых можно отправлять письма от имени вашего домена.',
                "You can add SPF and DKIM records to the control panel on the site of the company that provides you with DNS hosting services or contact your domain administrator.": "Вы можете добавить SPF и DKIM записи в панели управления на сайте компании, предоставляющей вам услуги DNS-хостинга или обратиться к администратору вашего домена.",
                "In order to allow amoCRM to send emails on behalf of your domain, you need to add the following DNS records:": "Для того, чтобы разрешить amoCRM отправку писем от имени вашего домена, необходимо добавить следующие DNS записи:",
                "Please note that the publication of DNS records may take up to 48 hours.": "Обращаем ваше внимание, что публикация DNS-записей может занять до 48 часов.",
                "The limit of emails sent is reached. #PLUG_BUTTON#, to increase the limit": "Достигнут лимит отправляемых писем. #PLUG_BUTTON#, для увеличения лимита",
