                "Unfortunately, we were unable to establish a connection with your server#SERVER#. It seems that the server settings are incorrect. Please fill in right ones.": "К сожалению, мы не смогли установить подключение с вашим сервером#SERVER#. Кажется, настройки сервера указаны некорректно. Пожалуйста, укажите верные данные.",
