                "It seems we don’t have the necessary access to work with your mailbox. To fix this please reconnect.": 'Кажется, у нас нет необходимых доступов для работы с вашим почтовым ящиком. Чтобы это исправить, пожалуйста, <span class="js-mailbox-button__reconnect mail-settings-mail__descr_link">возобновите подключение</span>.',
